import axios from 'axios'
import React, { useEffect, useRef, useState } from 'react'

const Full_stack_crud = () => {
    const first_name = useRef()
    const last_name = useRef()
    const email = useRef()
    const password = useRef()
    const confirm_password = useRef()
    const [input, setinput] = useState({})
    const [ind, setind] = useState()
    const [view, setview] = useState({})
    const [data, setdata] = useState([])
    const submit_handler = async () => {
        const input = {
            first_name: first_name.current.value,
            last_name: last_name.current.value,
            email: email.current.value,
            password: password.current.value,
            confirm_password: confirm_password.current.value,
        }
        await axios.post(
            "http://localhost:5500/v1/user/create", input)
            .then((res) => console.log(res))
            .catch((err) => console.log(err))
        setdata([...data, input])
    }
    useEffect(async () => {
        await axios.get("http://localhost:5500/v1/user/list", {
            // headers: { "content-type": "application/json" }
        })
            .then((res) => {
                setdata(res.data.data)
            })
            .catch((err) => console.log("EREERERR", err))
    }, [])

    const delete_handler = async (id, ind) => {
        console.log(`http://localhost:5500/v1/user/delete/${id}`);
        await axios.delete(`http://localhost:5500/v1/user/delete/${id}`, {
            // headers: { "content-type": "application/json" }
        })
            .then((res) => {
            })
            .catch((err) => console.log("EREERERR", err))
        data.splice(ind, 1)
        setdata([...data])
    }

    const update_view_handler = (val, ind) => {
        setview(val)
        setind(ind)
        console.log(view);
    }

    const update_handler = (e) => {
        setview({ ...view, [e.target.name]: e.target.value })
        console.log(view);
    }

    const update_final_handler = () => {
        data.splice(ind, 1, view)
        setdata([...data])
    }

    return (
        <>
            <center>
                <div style={{ marginTop: "150px" }}>
                    <div>
                        <label>first_name</label>
                        <input ref={first_name} type='text' />
                    </div>
                    <div>
                        <label>last_name</label>
                        <input ref={last_name} type='text' />
                    </div>
                    <div>
                        <label>email</label>
                        <input ref={email} type='email' required />
                    </div>
                    <div>
                        <label>password</label>
                        <input ref={password} type='text' />
                    </div>
                    <div>
                        <label>confirm password</label>
                        <input ref={confirm_password} type='text' />
                    </div>
                    <div>
                        <button onClick={submit_handler}>SUBMIT</button>
                    </div>
                </div>
            </center>
            <center>
                <div style={{ marginTop: "150px" }}>
                    <div>
                        <label>first_name</label>
                        <input value={view.first_name} name='first_name' onChange={update_handler} type='text' />
                    </div>
                    <div>
                        <label>last_name</label>
                        <input value={view.last_name} name='last_name' onChange={update_handler} type='text' />
                    </div>
                    <div>
                        <label>email</label>
                        <input value={view.email} name='email' onChange={update_handler} type='email' required />
                    </div>
                    <div>
                        <label>password</label>
                        <input value={view.password} name='password' onChange={update_handler} type='text' />
                    </div>
                    <div>
                        <label>confirm password</label>
                        <input value={view.confirm_password} name='confirm_password' onChange={update_handler} type='text' />
                    </div>
                    <div>
                        <button onClick={update_final_handler}>UPDATE</button>
                    </div>
                </div>
            </center>
            {
                data?.map((val, ind) => {
                    return (
                        <>
                            <h1>{val.first_name}</h1>
                            <h2>{val.last_name}</h2>
                            <h2>{val.email}</h2>
                            <h2>{val.password}</h2>
                            <button onClick={() => delete_handler(val._id, ind)}>DELETE</button>
                            <button onClick={() => update_view_handler(val, ind)}>UPDATE</button>
                        </>
                    )
                })
            }
        </>
    )
}

export default Full_stack_crud
